      <p>City : {userDetails.city}</p>
      <p>Phone no. : {userDetails.mobile}</p>

      <button>Edit</button>
      </center>

    </div>
  )
};

const mapDispatchToProps = (dispatch) => {
  return {
    UserProfile: () => dispatch(UserProfile()),
  };
};

